import React from 'react';

const Intro = () => {
    return (
        <div className="intro-container" id="intro">
            <div className="my-name-is">Welcome! My name is</div>
            <div className="ethan">Ethan Reinhart.</div>
            <div className="what-i-love">I am passionate about improving efficiency in AI.</div>
            <div className="mt-[2vh] w-[80vw] justify-center text-center text-[2vh] py-[1vh]">I am currently working on...
                <ol className="my-[1em] text-[2.5vh]">
                    <li className='my-[0.5em]'><span className='font-bold'><a className='hover:text-slate-700' href='http://www.growguppy.com/'>Guppy</a></span>, my start-up to provide an integrated payment portal for student organizations</li>
                    <li className='my-[0.5em]'>University of Oregon Accelerated Computer Science <span className='font-bold'>Master's</span> Program</li>
                    <li className='my-[0.5em]'>Machine Learning <span className='font-bold'>Research</span> under Professor Yu Wang</li>
                </ol>
                ...but I am always looking for a new challenge!
            </div>
        </div>
      );
}

export default Intro;
